import React, { Fragment } from 'react';
import styled from 'styled-components';

const BottomContainer = styled.div`
  background: orange;
  height: 500px;
  width: 1200px;
  clip-path: polygon(0px 382px, 439px 206px, 300px 0px, 0px 0px);
`;

const BottomSide = () => {
  return (
    <Fragment>
      <BottomContainer>

      </BottomContainer>
    </Fragment>
  );
}

export default BottomSide;
